import React from 'react';
import "./main.css"

export class Main extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            array : [1, 2, 3, 2, 1],
            desiredSweetness: 6
        }}

    getDesiredSweetness(){
        let desiredSweetness = this.state.desiredSweetness;
        let array = this.state.array;
        let sum = 0
        let fArray = []
        for(let i = 0; i <= array.length; i++){
            sum+=array[i]
            if(sum == desiredSweetness){
                fArray.push(i)
                return fArray
            }
        }
    }

    componentDidMount(){
        this.getDesiredSweetness()
    }
    
    render()
    
    {
        return(
            <div className="header">hello Alasj{{i}}</div>
        )
    }
}
